import React from "react";
import UserItem from "./UserItem/UserItem";
import axios from 'axios';

const userList = props => {

    let users = [];

    axios
        .get('')
        .then(response => {
            users = response.data;
        })
        .catch(error => {
            console.log(error);
        });


    return <div>{users.map((user, index) => (
        <UserItem source = {props.source} name = {props.name} age = {props.age} country = {props.country}/>
    ))}</div>;
};

export default userList;
